-- Table structure for im_inbox
-- ----------------------------
DROP TABLE IF EXISTS `im_inbox`;
CREATE TABLE `im_inbox`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `owner_id` bigint(20) NOT NULL COMMENT '谁的收件箱',
  `message_id` bigint(20) NOT NULL COMMENT '对应的消息id',
  `cvs_id` bigint(20) NOT NULL COMMENT '对应的会话id',
  `readed` tinyint(255) NOT NULL DEFAULT 0 COMMENT '消息是否已读：0-没有；1-已读',
  `sync_id` bigint(20) NOT NULL COMMENT '同步id，当个会话递增',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '消息创建时间，跟消息体时间保持一致',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '消息更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3010 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = DYNAMIC;

