-- ----------------------------
-- Table structure for im_session_view
-- ----------------------------
DROP TABLE IF EXISTS `im_session_view`;
CREATE TABLE `im_session_view`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `cvs_name` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会话名',
  `owner_id` bigint(20) NOT NULL COMMENT '谁的会话（会话的拥有者）',
  `cvs_type` tinyint(11) NOT NULL DEFAULT 0 COMMENT '会话类型；0-单聊；1-群聊',
  `relation_entity_id` bigint(20) NOT NULL COMMENT '会话关联对象的id，群聊为群id，单聊为用户id',
  `avatar_url` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会话头像url地址',
  `last_message` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会话的最近一条消息',
  `sender_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '最后一条消息发送者',
  `unread_message_num` int(11) NOT NULL DEFAULT 0 COMMENT '会话的未读消息数',
  `last_message_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '会话最近一条消息发送时间',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '会话创建时间',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '会话更新时间',
  `not_disturb` tinyint(4) NOT NULL DEFAULT 0 COMMENT '消息免打扰；0-关闭；1-开启；默认关闭',
  `stick` tinyint(4) NOT NULL DEFAULT 0 COMMENT ' 会话置顶；0-false；1-true；默认false',
  `ext` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '扩展字段',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_owner_id`(`owner_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 325 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '  会话列表' ROW_FORMAT = DYNAMIC;

